	"basicOptions": "{\n    xKey: \"popularity\",\n    yKey: \"ratings\",\n    groupKey: 'title',\n    sizeKey: \"ratings\",\n    shapeKey: 'genre'\n}",
	"canonicalSchemaId": "vsYvLpAJyvv4MiH2D",
	"canonicalTransform": "function canonical(relationalData, basicOptions) {\n    let subset = (a, b) =\u003e { // 'a' is a subset of 'b'\n        return (_.difference(a, b).length === 0);\n    };\n    \n    let keysWeNeed = [basicOptions.xKey, basicOptions.yKey];\n    \n    if (_.some(relationalData, row =\u003e {\n        return (! subset(keysWeNeed, _.keys(row)));\n    })) throw new Error(\"All keys in basic options need to be present in every object in the input data array\");\n\n    let shapeIndex = 0;\n    let shapeForKey = {};\n    let shapes = ['circle', 'cross', 'triangle-up', 'triangle-down', 'diamond', 'square'];\n    shapes.map(s =\u003e {\n        shapeForKey[s] = s;\n    });\n\n    let allValues = relationalData.map(function(row) {\n        let val = {\n            x: row[basicOptions.xKey],\n            y: row[basicOptions.yKey],\n            row: row,\n            key: (basicOptions.groupKey ? row[basicOptions.groupKey] : 'Default Group')\n        };\n        if (basicOptions.sizeKey) val.size = row[basicOptions.sizeKey];\n        if (basicOptions.shapeKey) {\n            if (! _.contains(shapes, row[basicOptions.shapeKey])) shapeForKey[row[basicOptions.shapeKey]] = shapes[shapeIndex++ % 6];\n            val.shape = shapeForKey[row[basicOptions.shapeKey]];\n        }\n        return val;\n    });\n    \n    let groupsObj = _.groupBy(allValues, 'key');\n    \n    let groups = [];\n    Object.keys(groupsObj).map(k =\u003e {\n        groups.push({\n            key: k,\n            values: groupsObj[k].map(v =\u003e {\n                delete v.key;\n                return v;\n            })\n        });\n    });\n    return groups;\n    \n}\n",
	"advancedOptions": "{\n  chart: {\n    type: \"scatterChart\",\n    margin: {\n        top: 20, \n        right: 30, \n        bottom: 40,\n        left: 60\n    },\n    scatter: {\n      onlyCircles: false\n    },\n    showLegend: true,\n    showDistX: true,\n    showDistY: true,\n    duration: 350,\n    xAxis: {\n      axisLabel: \"Popularity\"\n    },\n    yAxis: {\n      axisLabel: \"Ratings\",\n      axisLabelDistance: -5\n    },\n    pointRange: [200, 200],\n    zoom: {\n      enabled: false\n    }\n  }\n}",
