	"canonicalTransform": "function canonical(relationalData, basicOptions) {\n    let subset = (a, b) =\u003e { // 'a' is a subset of 'b'\n        return (_.difference(a, b).length === 0);\n    };\n    let keysWeNeed = [basicOptions.xKey];\n    if (_.some(relationalData, row =\u003e {\n        return (! subset(keysWeNeed, _.keys(row)));\n    })) throw new Error(\"xKey of basic options needs to be present in every object in the input data array\");\n\n    let allKeys = _.union(basicOptions.yKeys, basicOptions.barKeys);\n    let ts = allKeys.map(function(yKey) {\n        return {\n            key: yKey,\n            bar: _.contains(basicOptions.barKeys, yKey),\n            values: relationalData.map(function(row) {\n                return {\n                    x: row[basicOptions.xKey],\n                    y: row[yKey]\n                };\n            })\n        };\n    });\n    return ts; \n}",
